import { Box } from "@mui/material";

const Order = () => {
  <Box
    display="flex"
    alignItems="center"
    justifyContent="center"
    width="100%"
    bgcolor="primary.main"
    py={4}
    sx={{
      boxSizing: "border-box",
    }}
  ></Box>;
};

export default Order;
